import type {Course, CvModel, PersonalInfo} from "../models/CvModel";
import {jsPDF} from "jspdf";


const ME = "data:image/png;base64,"
const LOCATION = "data:image/png;base64,"
const PHONE = "data:image/png;base64,"
const EMAIL = "data:image/png;base64,"
const LINK = "data:image/png;base64,"
const CAR = "data:image/png;base64,"

const GITHUB = "data:image/png;base64,"

const DEFAULT_Y_POS = 24
const DEFAULT_X_POS = 48
const HEADER_SIZE = 15
const TEXT_SIZE = 11
const SUBTITLE_SIZE = 13
const ME_SIZE = 24
const HEADER_COLOR = "#51859C"
const SUBTITLE_COLOR = "#9C7F5D"
const TEXT_COLOR = "#000000"

export default function GenerateCv(cv: CvModel, language: string) {

    let filename = "cv_charlier_guillaume_" + language.toUpperCase() + ".pdf";

    let pdf: jsPDF = new jsPDF("p", "px", "a4")

    let yPos = DEFAULT_Y_POS;
    let xPos = DEFAULT_X_POS;
    let optionsCol1 = {maxWidth: 95}
    let optionsCol2 = {maxWidth: 232}

    function goDown(howMany: number) {
        yPos += howMany;

        if (pdf.internal.pageSize.height - 20 <= yPos) {
            yPos = 48;
            if (pdf.getNumberOfPages() !== pdf.getCurrentPageInfo().pageNumber) {
                pdf.movePage(pdf.getCurrentPageInfo().pageNumber + 1)
            } else {
                pdf.addPage("a4", "p");
            }
        }
    }

    function start() {
        pdf.movePage(1)
        xPos = 166
        yPos = 90
    }
    
    function course(label: string, courses: [Course]) {
        pdf.setFontSize(HEADER_SIZE)
        pdf.setTextColor(HEADER_COLOR)
        pdf.text(label, xPos, yPos, optionsCol2)
        goDown(20)

        for (let course of courses) {
            pdf.setFontSize(SUBTITLE_SIZE)
            pdf.setTextColor(SUBTITLE_COLOR)
            label = course.start !== "" ? course.start + " / " : ""
            label += course.end + " - " + course.label

            pdf.text(label, xPos, yPos, optionsCol2)
            if (Math.round(pdf.getTextWidth(label)) >= optionsCol2.maxWidth) {
                goDown(25)
            }
            else {
                goDown(12)
            }

            pdf.setFont(pdf.getFont().fontName, "bold")
            pdf.text(course.place, xPos, yPos, optionsCol2)
            if (Math.round(pdf.getTextWidth(course.place)) >= optionsCol2.maxWidth) {
                goDown(10)
            }
            pdf.setFont(pdf.getFont().fontName, "normal")
            pdf.setFontSize(TEXT_SIZE)
            pdf.setTextColor(TEXT_COLOR)


            for (let detail of course.details) {
                goDown(13)
                pdf.text("- " + detail, xPos + 8, yPos, optionsCol2)
                if (Math.round(pdf.getTextWidth(detail)) >= optionsCol2.maxWidth) {
                    goDown(5)
                }
            }
            goDown(20)
        }
    }

    function list(label: string, elements: [string], options = optionsCol1) {

        pdf.setFontSize(HEADER_SIZE)
        pdf.setTextColor(HEADER_COLOR)
        pdf.text(label, xPos, yPos, options)
        pdf.setFontSize(TEXT_SIZE)
        pdf.setTextColor(TEXT_COLOR)

        for (let element of elements) {
            goDown(13)
            pdf.text("- " + element, xPos + 8, yPos, options)
            if (Math.round(pdf.getTextWidth(element)) >= options.maxWidth) {
                goDown(5)
            }
        }
        goDown(30)
    }

    function getPersonalInfo(personalInfo: PersonalInfo) {
        goDown(56)
        pdf.addImage(LOCATION, "PNG", xPos, yPos - 5, 10, 13)
        pdf.text(personalInfo.address.number + ", " + personalInfo.address.street +  " " + personalInfo.address.postalCode + " " + personalInfo.address.town
            , xPos + 15, yPos, optionsCol1)

        goDown(26)
        pdf.addImage(PHONE, "PNG", xPos, yPos - 8, 10, 10)
        pdf.text(personalInfo.phone, xPos + 15, yPos, optionsCol1)

        goDown(18)
        pdf.addImage(EMAIL, "PNG", xPos, yPos - 3, 10, 10)
        pdf.text(personalInfo.email, xPos + 15, yPos, optionsCol1)

        goDown(26)
        pdf.addImage(LINK, "PNG", xPos, yPos - 3, 10, 10)
        pdf.text(personalInfo.linkedIn, xPos + 15, yPos, optionsCol1)

        goDown(26)
        pdf.addImage(CAR, "PNG", xPos, yPos - 7, 10, 10)
        pdf.text(personalInfo.drivingLicence, xPos + 15, yPos, optionsCol1)

        goDown(18)
        pdf.addImage(GITHUB, "PNG", xPos, yPos - 7, 10, 10)
        pdf.text(personalInfo.github, xPos + 15, yPos, optionsCol1)
    }

    // HEADER
    pdf.addImage(ME, "PNG", xPos, yPos, 80, 80)
    goDown(18)
    pdf.setFontSize(ME_SIZE)

    pdf.text("Charlier Guillaume".toUpperCase(), pdf.internal.pageSize.width - 280, yPos)
    goDown(24)
    pdf.setTextColor(HEADER_COLOR)
    pdf.text(cv.labels.job, pdf.internal.pageSize.width - 280, yPos)
    pdf.setTextColor(TEXT_COLOR)
    pdf.setFontSize(TEXT_SIZE)

    // END

    getPersonalInfo(cv.personalInfo)

    goDown(30)

    list(cv.labels.qualities, cv.qualities)
    list(cv.labels.languages, cv.languages)
    list(cv.labels.hobbies, cv.hobbies)

    start()

    course(cv.labels.experiences, cv.experiences)
    course(cv.labels.formations, cv.formations)

    goDown(40)
    list(cv.labels.itSkills, cv.itSkills, optionsCol2)

    pdf.save(filename)


}